package main

import (
	"encoding/hex"
	"fmt"
	"math/rand"
	"time"

	"github.com/anoop-dhiman/lbry.go/v2/claim"

	log "github.com/sirupsen/logrus"
)

var Version string

func main() {
	rand.Seed(time.Now().UnixNano())
	log.SetLevel(log.DebugLevel)

	value, err := hex.DecodeString("")
	if err != nil {
		panic(err)
	}
	s, err := claim.ToJSON(value)
	if err != nil {
		panic(err)
	}
	fmt.Println(s)
}
